import React, { Component } from "react";
import "./Page2.css";

class Page2 extends Component {
  state = {};

  render() {
    return (
      <div className="page2">
        <p className="page2-description">{this.props.page2.description}</p>
        {this.props.page2.tiles.map(tile => {
          return <Tile tile={tile} />;
        })}
      </div>
    );
  }
}

export default Page2;
